import React from "react";
import { useAuth } from "../context/AuthContext";

export default function LoginPage() {
  const { account, login, isAuthenticated } = useAuth();

  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      {isAuthenticated ? (
        <>
          <h2>You are already logged in as {account?.name || "User"}</h2>
          <p>Navigate using the navbar above.</p>
        </>
      ) : (
        <>
          <h2>Welcome to Open Source Project Finder</h2>
          <button onClick={login} aria-label="Login with Auth0">
            Login with Auth0
          </button>
        </>
      )}
    </div>
  );
}
